// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VaccineAppointment {
    struct Appointment {
        uint256 appointmentId;
        string vaccineName;
        address patientAddress;
        address doctorAddress;
        address cashierAddress;
        string centerName;
        string date;
        string time;
        Status status;
    }
    
    enum Status {
        PENDING,
        CANCELLED,
        PROCESSING,
        COMPLETED
    }
    
    uint256 private nextAppointmentId = 1;
    mapping(uint256 => Appointment) private appointments;
    uint256[] private appointmentIds;
    
    // Events
    event AppointmentCreated(uint256 appointmentId, address patientAddress, string centerName);
    event AppointmentUpdated(uint256 appointmentId, address doctorAddress, address cashierAddress, Status status);
    event StatusUpdated(uint256 appointmentId, Status newStatus);
    
    // Create a new appointment with specified patient address
    function createAppointment(
        string memory _vaccineName,
        string memory _centerName,
        string memory _date,
        string memory _time,
        address _patientAddress
    ) external {
        require(_patientAddress != address(0), "Invalid patient address");
        
        uint256 appointmentId = nextAppointmentId++;
        
        appointments[appointmentId] = Appointment({
            appointmentId: appointmentId,
            vaccineName: _vaccineName,
            patientAddress: _patientAddress,
            doctorAddress: address(0),
            cashierAddress: address(0),
            centerName: _centerName,
            date: _date,
            time: _time,
            status: Status.PENDING
        });
        
        appointmentIds.push(appointmentId);
        emit AppointmentCreated(appointmentId, _patientAddress, _centerName);
    }
    
    // Get all appointments
    function getAllAppointments() external view returns (Appointment[] memory) {
        Appointment[] memory allAppointments = new Appointment[](appointmentIds.length);
        
        for (uint256 i = 0; i < appointmentIds.length; i++) {
            allAppointments[i] = appointments[appointmentIds[i]];
        }
        
        return allAppointments;
    }
    
    // Get appointments by patient address
    function getAppointmentsByPatient(address _patientAddress) external view returns (Appointment[] memory) {
        uint256 count = 0;
        
        // First count how many appointments the patient has
        for (uint256 i = 0; i < appointmentIds.length; i++) {
            if (appointments[appointmentIds[i]].patientAddress == _patientAddress) {
                count++;
            }
        }
        
        // Then create and fill the array
        Appointment[] memory patientAppointments = new Appointment[](count);
        uint256 index = 0;
        
        for (uint256 i = 0; i < appointmentIds.length; i++) {
            if (appointments[appointmentIds[i]].patientAddress == _patientAddress) {
                patientAppointments[index] = appointments[appointmentIds[i]];
                index++;
            }
        }
        
        return patientAppointments;
    }
    
    // Get appointments by center name
    function getAppointmentsByCenter(string memory _centerName) external view returns (Appointment[] memory) {
        uint256 count = 0;
        
        // First count how many appointments are for this center
        for (uint256 i = 0; i < appointmentIds.length; i++) {
            if (keccak256(bytes(appointments[appointmentIds[i]].centerName)) == keccak256(bytes(_centerName))) {
                count++;
            }
        }
        
        // Then create and fill the array
        Appointment[] memory centerAppointments = new Appointment[](count);
        uint256 index = 0;
        
        for (uint256 i = 0; i < appointmentIds.length; i++) {
            if (keccak256(bytes(appointments[appointmentIds[i]].centerName)) == keccak256(bytes(_centerName))) {
                centerAppointments[index] = appointments[appointmentIds[i]];
                index++;
            }
        }
        
        return centerAppointments;
    }
    
    // Update appointment with doctor and cashier addresses, set status to PROCESSING
    function processAppointment(
        uint256 _appointmentId,
        address _doctorAddress,
        address _cashierAddress
    ) external {
        require(appointments[_appointmentId].appointmentId != 0, "Appointment does not exist");
        require(appointments[_appointmentId].status == Status.PENDING, "Appointment must be in PENDING status");
        
        appointments[_appointmentId].doctorAddress = _doctorAddress;
        appointments[_appointmentId].cashierAddress = _cashierAddress;
        appointments[_appointmentId].status = Status.PROCESSING;
        
        emit AppointmentUpdated(_appointmentId, _doctorAddress, _cashierAddress, Status.PROCESSING);
    }
    
    // Update status to COMPLETED
    function completeAppointment(uint256 _appointmentId) external {
        require(appointments[_appointmentId].appointmentId != 0, "Appointment does not exist");
        require(appointments[_appointmentId].status == Status.PROCESSING, "Appointment must be in PROCESSING status");
        
        appointments[_appointmentId].status = Status.COMPLETED;
        emit StatusUpdated(_appointmentId, Status.COMPLETED);
    }
    
    // Update status to CANCELLED
    function cancelAppointment(uint256 _appointmentId) external {
        require(appointments[_appointmentId].appointmentId != 0, "Appointment does not exist");
        require(
            appointments[_appointmentId].status == Status.PENDING || 
            appointments[_appointmentId].status == Status.PROCESSING,
            "Appointment must be in PENDING or PROCESSING status"
        );
        
        // Only patient or admin (contract owner in a real implementation) can cancel
        require(
            appointments[_appointmentId].patientAddress == msg.sender,
            "Only patient can cancel the appointment"
        );
        
        appointments[_appointmentId].status = Status.CANCELLED;
        emit StatusUpdated(_appointmentId, Status.CANCELLED);
    }
    
    // Helper function to get a single appointment
    function getAppointment(uint256 _appointmentId) external view returns (Appointment memory) {
        require(appointments[_appointmentId].appointmentId != 0, "Appointment does not exist");
        return appointments[_appointmentId];
    }
}
